import React from 'react';
import brain from './brain.jpg';
import Tilt from 'react-tilt';
const Logo = ()=>{
	return(
		<Tilt className="Tilt" options={{ max : 25 }} style={{ height: 150, width: 150 }} >
		 <div className="Tilt-inner"> 
		 	<img alt="logo" src={brain} />
		 </div>
		</Tilt>
 	);
}
export default Logo;
